import ExpenseItem from "./components/ExpenseItem";

function App() {

  const expenseItems = [
    {
      count : 'Item 1',
      itemType : 'Food',
      expenditureLocation : "Hyderabad",
      itemCost : 'Rs:200/-'
    },
    {
      count : 'Item 2',
      itemType : 'Petrol',
      expenditureLocation : "Kakinada",
      itemCost : 'Rs:500/-',
    },
    {
      count : 'Item 3',
      itemType : 'Movies',
      expenditureLocation : "Vijayawada",
      itemCost : 'Rs:100/-',
    },
    {
      count : 'Item 4',
      itemType : 'T-shirt',
      expenditureLocation : "Vijayawada",
      itemCost : 'Rs:100/-',
    }
  ];

  return (
    <div>
      <h1>Let's get started!</h1>
      <h1>Expense items..</h1>
      <ExpenseItem
      ExpenseCount={expenseItems[0].count}
      ExpenseType={expenseItems[0].itemType}
      ExpenseLocation={expenseItems[0].expenditureLocation}
      ExpenseCost={expenseItems[0].itemCost} >
      </ExpenseItem>

      <ExpenseItem
      ExpenseCount={expenseItems[1].count}
      ExpenseType={expenseItems[1].itemType}
      ExpenseLocation={expenseItems[1].expenditureLocation}
      ExpenseCost={expenseItems[1].itemCost} >
      </ExpenseItem>

      <ExpenseItem
      ExpenseCount={expenseItems[2].count}
      ExpenseType={expenseItems[2].itemType}
      ExpenseLocation={expenseItems[2].expenditureLocation}
      ExpenseCost={expenseItems[2].itemCost} >
      </ExpenseItem>

      <ExpenseItem
      ExpenseCount={expenseItems[3].count}
      ExpenseType={expenseItems[3].itemType}
      ExpenseLocation={expenseItems[3].expenditureLocation}
      ExpenseCost={expenseItems[3].itemCost} >
      </ExpenseItem>
    </div>
  );
}

export default App;
